import React,{useState, useEffect} from 'react';
import PastCard from '../PastCard'
import {Section} from './styles'
import getPastLaunches from "../../services/getPastLaunches";

const PastLayout = () => {

  const [pastlaunches, setpastlaunches] = useState([]);

  useEffect(() => {
    getPastLaunches().then((data) => setpastlaunches(data));
  }, []);
  console.log(pastlaunches)
  return (
    <Section>
       {pastlaunches.map((item, index)=>{
        return (
          <PastCard
            key={item.id}
            title={item.name}
            detail={item.details}
            image={item.links.patch.small}
            number={item.flight_number}
            date={item.date_local}
            succes={item.succes? 'succes':'fail'}
          />
       )})
        } 
    </Section>
  );
};

export default PastLayout;
